import React, { FC } from 'react';
interface PictureProps {
  src: string;
  caption: string;
}
interface ProjectProps {
  title: string;
  hours: number;
  pictures: [PictureProps];
}
const Projects: FC = () => {
  const projects = {
    title: '',
    hours: 0,
    pictures: [{ src: '', caption: '' }],
  };

  return <>Sup dog</>;
};

export default Projects;
